      SELECT - col1 / - col1 + - col1 * - tab1.col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( col1 ) BETWEEN ( NULL ) AND ( col2 + + col1 );
  - name: tab1

outputs:
  - name: q2765.out
    data: |
